import api from "./baseApi";

export const userApi = {
  getUsers(params, cancelToken) {
    return api.get("/api/users", { params, cancelToken });
  },
  getAllUsers(cancelToken) {
    return api.get("/api/users/all", { cancelToken });
  },
  getUser(params) {
    return api.get(`/api/users/${params.id}`, { params });
  },
  getProfile(params) {
    return api.get("/api/users/profile", { params });
  },
  getUserStatistic(params) {
    return api.get(`/api/users/user-statistic/${params.userId}`, { params });
  },
  putProfile(params) {
    return api.put("api/users/edit-profile", params);
  },
  patchUserTag(params) {
    return api.patch(`api/users/tag/${params.id}`, params);
  },
  patchUserTick(userId, tick) {
    return api.patch(`/api/users/yellow-tick/${userId}`, tick);
  },
  deleteUser(params) {
    return api.delete(`/api/users/${params.id}`);
  },
  getCountUsers(params) {
    return api.get(`/api/users/count?${params}`);
  },
  logoutAllUser() {
    return api.post(`/api/admin/force-logout`);
  },
};
